        \       <event_infotext type=\"PropertyString\"><![CDATA[<p><strong>Den kinesiska
        e-handelsjätten Alibaba drar in 22 miljarder kronor under kvartalet. Samtidigt
        skruvar bolaget upp prognoserna.</strong></p> <p>Den kinesiska näthandelsjätten
        Alibaba gör ett nettoresultat på 17,4 miljarder yuan, motsvarande drygt 22
        miljarder kronor, för det andra kvartalet i det brutna räkenskapsåret 2017/2018.</p><p>Samma
        period förra året var vinsten omkring 9 miljarder kronor. Alibaba har alltså
        mer än fördubblat vinsten.</p><p>Justerat resultat per aktie var 8:57 yuan.
        Det är betydligt högre än analytikernas förväntningar på ett resultat på 6:86
        yuan per aktie, enligt Bloomberg News snittprognos.</p>]]></event_infotext>\r\n
        \       <event_completion_text type=\"PropertyString\"><![CDATA[<p><strong>&amp;nbsp;Nu
        lanseras deras digitala kompis</strong></p> &amp;nbsp;<p>&amp;nbsp;</p><p>Under
        torsdagen lanseras Shim, en svensk app som vill vara en digital kompis till
        användaren. Appen är baserad på psykologisk forskning, men är inte avsedd
        som en behandling för psykisk ohälsa. Istället ska man kunna prata med Shim
        om vardagens bekymmer.</p><p>”Evolutionen har format oss människor till att
        i första hand uppmärksamma det som är negativt. Därför kan det få stora effekter
        om man tränar på det positiva. Samtalet med Shim är ett enkelt sätt att göra
        just det”, säger Hoa Ly som är medgrundare av Shim och doktor i psykologi.</p>]]></event_completion_text>\r\n
        \       <event_aftertext type=\"PropertyString\"><![CDATA[<p><strong>Courtagefri
        aktieapp når 3 miljoner användare</strong></p><p>Nätmäklaren Robinhood har
        nu nått tre miljoner registrerade använder, rapporterar&amp;nbsp;<a title=\"https://techcrunch.com/2017/11/01/robinhood-for-web/\"
        href=\"https://techcrunch.com/2017/11/01/robinhood-for-web/\" target=\"_blank\">Techcrunch</a>.</p><p>Det
        speciella med nätmäklaren är att de erbjuder courtagefri aktiehandel i USA.&amp;nbsp;Bolaget
        tjänar pengar på en premiumtjänst som låter användarna låna pengar för att
        handla.&amp;nbsp;</p><p><strong>Läs även:&amp;nbsp;<a title=\"https://digital.di.se/artikel/efter-courtagechocken-sigmastocks-i-samarbete-med-nordea\"
        href=\"https://digital.di.se/artikel/efter-courtagechocken-sigmastocks-i-samarbete-med-nordea\">Efter
        courtagechocken – Sigmastocks i samarbete med Nordea</a></strong></p><p>Samtidigt
        meddelar bolaget att transaktioner till ett värde av över 800 miljarder kronor
